import React from 'react';//import React
import Container from '@mui/material/Container'; //import "Container" component from material UI library

const CustomContainer = () => {
  return (
    <Container
      maxWidth="sm"  // Customize the width of the container (e.g., "sm", "md", "lg", "xl" or a specific value like "600")
      sx={{ backgroundColor: 'blue', color: 'white' }} // Customize the background color and text color using the sx prop
    >
      {/* Your content here */}

      "Hello, I am a Container"
    </Container>
  );
};

export default CustomContainer;
